mapper.select:

select 

from RMOUTT
where RMOUTT_TXDATE = #{rmouttTxdate,jdbcType=CHAR}
  and RMOUTT_BRNO = #{rmouttBrno,jdbcType=CHAR}
  and RMOUTT_ORIGINAL = #{rmouttOriginal,jdbcType=CHAR}
  and RMOUTT_FEPNO = #{rmouttFepno,jdbcType=CHAR}

mapper.delete:

delete from RMOUTT
where RMOUTT_TXDATE = #{rmouttTxdate,jdbcType=CHAR}
  and RMOUTT_BRNO = #{rmouttBrno,jdbcType=CHAR}
  and RMOUTT_ORIGINAL = #{rmouttOriginal,jdbcType=CHAR}
  and RMOUTT_FEPNO = #{rmouttFepno,jdbcType=CHAR}
